import "./PirateLogin.css";
const PirateLogin = () => {
  return (
    <div id="pirateHome">
      <div id="pirateDiv">
        Enter userId : <input type="text" />
        <br />
        Enter Password : <input type="password" />
        <br />
        New User ? <br />
        <a href="/piratesignup"> SignUP</a>
      </div>
    </div>
  );
};

export default PirateLogin;
